import { useState } from "react";
import YouTubeEmbed from "./YouTubeEmbed";

function addEmoji(name) {
  switch (name) {
    case "Attack":
      return "Attack ü•ä";
    case "Sweep":
      return "Sweep üßπ";
    case "Escape":
      return "Escape üèÉ‚Äç‚ôÇÔ∏è‚Äç‚û°Ô∏è";
    case "Transition":
      return "Transition üîÑ";
    case "Takedown":
      return "Takedown ü§º‚Äç‚ôÇÔ∏è";
    case "Guard Pass":
      return "Guard Pass üêç";
    case "Gi":
      return "Gi ü•ã";
    case "No Gi":
      return "No Gi ‚ùåü•ã‚ùå";
    default:
      return name;
  }
}

function Dropdown3({ name, moves, fightStyle }) {
  const [dropdown, setDropdown] = useState(false);

  return (
    <div className="dropdown">
      <button className="dropdown-btn" onClick={() => setDropdown(!dropdown)}>
        {addEmoji(name)}
      </button>
      {dropdown &&
        moves
          .filter(
            (move) => move.fightStyle === fightStyle && move.type === name
          )
          .map((move) => (
            <div className="youtube-embed" key={move.id}>
              <h1>{move.name}</h1>
              <YouTubeEmbed videoId={move.id} />
            </div>
          ))}
    </div>
  );
}

export default Dropdown3;
